  return (
    <div className="home">
      <Banner />
      <div className="home_section">
        <Card src="" title="" description="" />
        <Card />
        <Card />
      </div>
      <div className="home_section">
        <Card />
        <Card />
        <Card />
      </div>
      <h2>Footer</h2>
    </div>
  );
}

export default Home;
